pragma solidity ^0.4.24;

import "./Utilities.sol";


contract Owned {
    address public owner;

    constructor() public {
        owner = msg.sender;
    }

    modifier onlyOwner {
        require(msg.sender == owner);
        _;
    }

    function transferOwnership(address newOwner) internal onlyOwner {
        owner = newOwner;
    }
}

contract OhanaCoin is Owned {

    struct Wallet {
        uint256 spendBalance;       // Personal balance for each user (used for prizes, etc)
        uint256 transferBalance;    // Available coins to give to other users
        uint8 numTransfers;         // Amount of transfers each user has made in a quarter
    }

    // Check for some conditions before transferring any coins
    modifier transferChecks(address _from, address _to, uint _value) {
        // Prevent transfer to 0x0 address. Use burn() instead
        require(_to != 0x0);
        // Check if the sender has enough
        require(balanceOf[_from].transferBalance >= _value);
        // Check if sender has transferred too many times already
        if (msg.sender != owner)
            require(balanceOf[_from].numTransfers < transferLimit - 1);
        _;
    }

    // Public variables of the token
    string public name = "OhanaCoin";
    string public symbol = "OHN";
    uint8 public transferLimit = 3;
    uint8 public adminTransferLimit = 5;
    uint8 public monthlyAllowance = 30;
    uint256 public totalSupply;

    // This creates an array with all balances
    mapping (address => Wallet) public balanceOf;                     // Maps user to his/her balances
    mapping (address => mapping (address => uint256)) public allowance;  // Users that are allowed to spend other users' coins (admins)

    // This generates a public event on the blockchain that will notify clients (transaction)
    event Transfer(address indexed from, address indexed to, uint256 value);
    event Approval(address indexed _owner, address indexed _spender, uint256 _value);

    /**
     * Constrctor function
     *
     * Initializes contract with initial supply tokens to the creator of the contract
     */
    constructor(uint256 initialSupply) public {
        owner = msg.sender;                                     // Owner will mint new coins every month
        totalSupply = initialSupply;                            // Set totalSupply
        balanceOf[owner].transferBalance = totalSupply;        // Give the creator all initial tokens
        emit Transfer(0, owner, totalSupply);
    }

    /**
     * Internal transfer, only can be called by this contract. The tokens are transfered 
     * to the _to address's spending balance. This facilitates user to user transactions.
     * 
     * @param _from The address of the sender
     * @param _to The address of the recipient
     * @param _value The amount to send
     */
    function _transferSpend(address _from, address _to, uint _value) internal transferChecks(_from, _to, _value) {
        // Check for overflows
        require(balanceOf[_to].spendBalance + _value > balanceOf[_to].spendBalance);
        // Save this for an assertion in the future
        uint previousBalances = balanceOf[_from].transferBalance + balanceOf[_to].spendBalance;
        // Subtract from the sender
        balanceOf[_from].transferBalance -= _value;
        // Add the same to the recipient
        balanceOf[_to].spendBalance += _value;
        emit Transfer(_from, _to, _value);
        // Asserts are used to use static analysis to find bugs in your code. They should never fail
        assert(balanceOf[_from].transferBalance + balanceOf[_to].spendBalance == previousBalances);
        balanceOf[msg.sender].numTransfers += 1;
    }

    /**
     * Internal transfer, only can be called by this contract. The tokens are transfered 
     * to the _to address's transfer balance. This facilitates monthly allowances of transferable 
     * tokens for each user from the owner.
     * 
     * @param _from The address of the sender
     * @param _to The address of the recipient
     * @param _value The amount to send
     */
    function _transferOther(address _from, address _to, uint _value) internal transferChecks(_from, _to, _value) {
        // Check for overflows
        require(balanceOf[_to].transferBalance + _value > balanceOf[_to].transferBalance);
        // Save this for an assertion in the future
        uint previousBalances = balanceOf[_from].transferBalance + balanceOf[_to].transferBalance;
        // Subtract from the sender
        balanceOf[_from].transferBalance -= _value;
        // Add the same to the recipient
        balanceOf[_to].transferBalance += _value;
        emit Transfer(_from, _to, _value);
        // Asserts are used to use static analysis to find bugs in your code. They should never fail
        assert(balanceOf[_from].transferBalance + balanceOf[_to].transferBalance == previousBalances);
    }

    /**
     * Transfer tokens to either the spending or transfer balance
     *
     * Send `_value` tokens to `_to` from your account
     *
     * @param _to The address of the recipient
     * @param _value the amount to send
     */
    function transfer(address _to, uint256 _value) public {
        if (msg.sender != owner) _transferSpend(msg.sender, _to, _value);
        else _transferOther(msg.sender, _to, _value);
    }

     /**
     * Transfer tokens from other address
     *
     * Send `_value` tokens to `_to` in behalf of `_from`
     *
     * @param _to The address of the recipient
     * @param _value The amount to send
     */
    function transferFrom(address _to, uint256 _value) public returns (bool success) {
        require(_value <= allowance[owner][msg.sender]);     // Check allowance
        require(_value <= adminTransferLimit);             // Admins can't transfer more than a certain amount
        allowance[owner][msg.sender] -= _value;
        _transferSpend(owner, _to, _value);                // Transfer to spending balance
        return true;
    }

    /**
     * Set allowance for other address
     *
     * Allows `_spender` to spend no more than `_value` tokens in your behalf
     *
     * @param _value The max amount they can spend
     */
    function approve(uint256 _value) public returns (bool success) {
        allowance[owner][msg.sender] = _value;            // Admin can send coins from central owner to users
        return true;
    }

    /**
    * Every month, every user withdraws monthlyAllowance tokens from root account into his/her transfer balance
    */
    function withdrawAllowance() public {
        require(balanceOf[owner].transferBalance >= monthlyAllowance);
        balanceOf[msg.sender].transferBalance += monthlyAllowance;
        balanceOf[owner].transferBalance -= monthlyAllowance;
    }

    // /**
    //  * Destroy tokens
    //  *
    //  * Remove `_value` tokens from the system irreversibly
    //  *
    //  * @param _value the amount of money to burn
    //  */
    // function burn(uint256 _value) public returns (bool success) {
    //     require(balanceOf[msg.sender].transferBalance >= _value);   // Check if the sender has enough in transferable coins
    //     balanceOf[msg.sender].transferBalance -= _value;            // Subtract from the sender
    //     totalSupply -= _value;                                       // Updates totalSupply
    //     emit Burn(msg.sender, _value);
    //     return true;
    // }

    /**
     * Destroy tokens from other account
     *
     * Remove `_value` tokens from the system irreversibly on behalf of `_from`.
     *
     * @param _from The address of the sender
     * @param _value The amount of money to burn
     * @param balanceType Which balance to burn from 
     */
    function burnFrom(address _from, uint256 _value, string balanceType) public onlyOwner returns (bool success) {
        require(balanceOf[_from].transferBalance >= _value);   // Check if the targeted balance is enough
        if (Utilities.compareStrings(balanceType, "Transfer"))     // Subtract from the targeted balance
            balanceOf[_from].transferBalance -= _value;  
        else if (Utilities.compareStrings(balanceType, "Spend")) 
            balanceOf[_from].spendBalance -= _value;
        else 
            revert();
        // allowance[_from][msg.sender] -= _value;                // Subtract from the sender's allowance
        totalSupply -= _value;                                  // Update totalSupply
        emit Transfer(_from, 0, _value);
        return true;
    }

    /**
     * Owner of contract can mint new tokens
     * 
     * @param mintAmount The amount to create
     */
    function mintTokens(uint256 mintAmount) public onlyOwner {
        balanceOf[msg.sender].transferBalance += mintAmount;
        totalSupply += mintAmount;
        emit Transfer(0, owner, mintAmount);
    }

    function setUserTransferLimit(uint8 limit) public onlyOwner {
        transferLimit = limit;
    }

    function setAdminTransferLimit(uint8 limit) public onlyOwner {
        adminTransferLimit = limit;
    }

    function getTransferBalance(address user) public view returns (uint256 balance) {
        return balanceOf[user].transferBalance;
    }

    function getSpendBalance(address user) public view returns (uint256 balance) {
        return balanceOf[user].spendBalance;
    }

}

